import React from 'react';
import "./works.css";
import portfolio from "../../assets/portfolio.jpg";
import portfolio1 from "../../assets/portfolio1.jpg";
import portfolio2 from "../../assets/portfolio2.jpg";
import portfolio3 from "../../assets/portfolio3.jpg";
import portfolio4 from "../../assets/portfolio4.jpg";
import portfolio5 from "../../assets/portfolio5.jpg";

function Works() {
  return (
    <selection id="works">
        <h2 className="worksTitle">MY Portfolio</h2>
        <span className="worksDesc">i take pride in paying attention to the smallest details and making sure that my work is pixel
         prefect. i am excited to bring my skills and experience to help businesses achieve their goals and create a strong online presence </span>
        <div className="worksImgs">
            <img src={portfolio} alt="" className="worksImg" />
            <img src={portfolio1} alt="" className="worksImg" />
            <img src={portfolio2} alt="" className="worksImg" />
            <img src={portfolio3} alt="" className="worksImg" />
            <img src={portfolio4} alt="" className="worksImg" />
            <img src={portfolio5} alt="" className="worksImg" />
        </div>
    </selection>
  )
}

export default Works
